profile:
Le franchiseur Vitres.Net a vu le jour en 1994 grâce à deux jeunes entrepreneurs qui avaient la passion et la volonté de développer la relève entrepreneuriale au Québec. Ils ont donc mis sur pied un projet 100 % Québécois qui permet à des étudiants du cégep et de l’université de partout au Québec de démarrer leur propre entreprise pendant leurs études et de développer leurs aptitudes en gestion dans un milieu encadré et stimulant.

En plus d’offrir un service professionnel et courtois à des prix compétitifs à leurs clients, les jeunes entrepreneurs embauchent majoritairement des étudiants de niveau collégial et universitaire pour l’été, créant ainsi de l’emploi pour les jeunes.

Aujourd’hui, Vitres.Net c’est :

Plus de 60 franchisés ;
Plus de 350 emplois saisonniers créés ;
Plus de 11 000 contrats produits par année ;
Plus de 4 millions de dollars de chiffre d’affaires annuellement.
Depuis les débuts de Vitres.Net, plus de 25 000 résidences de la province ont profité de ses services résidentiels. (visitez notre page À propos pour en savoir davantage).
